If you want to load data from an API then the fetch API is the best way to do that in JavaScript. At first the fetch API may seem straightforward, but as you use it more and more you will realize it has a lot of depth. In this article I will cover the basics of fetch, more advanced use cases for fetch, and then finally I will cover the common issues people run into with fetch.

If you prefer to learn visually, check out the video version of this article.

Fetch API Basics
The fetch API is a promise based API, so if you are unfamiliar with promises you need to read my JavaScript promises ultimate guide first.

The simplest way you can call the fetch API is to just pass a URL to the fetch function.

fetch("https://jsonplaceholder.typicode.com/users")
This will return a promise that contains the response data. This response data contains properties for the status as well as methods for converting the raw response data to JSON, text, or other formats.

fetch("https://jsonplaceholder.typicode.com/users").then(res => {
  console.log(res.ok) // true
  console.log(res.status) // 200
  return res.json()
})
The highlighted code above is calling the json method on our response and it is returning that from the .then function. This is because the json method also returns a promise that evaluates to the JSON data from our response. We can chain a second .then to get the data from the json method.

fetch("https://jsonplaceholder.typicode.com/users")
  .then(res => res.json())
  .then(data => console.log(data))
// [{ userOne }, { userTwo }, ...]
This is what most of your fetch requests will look like if you are fetching data from a JSON api. We first fetch the URL, then we convert the response to JSON, and finally we use the data in the final .then.

Fetch Options
This will cover a some of your fetch uses, but often times you will need to pass additional options to fetch in order to configure it. The fetch function takes a second options object parameter which contains a large list of potential options.

Common Options
While there are multiple options you can pass to fetch there are a few that you will use more often than the others.

method
By far the most commonly used option is the method option. This option allows you to set which HTTP verb you want to use (GET, POST, PUT, DELETE, etc).

fetch("https://jsonplaceholder.typicode.com/users/2", {
  method: "DELETE",
})
body
If you are modifying the method then chances are you will need to pass data along with your request. That is where the body option comes in. The body does not accept objects so if you want to pass JSON to your API you must first convert it to a string.

fetch("https://jsonplaceholder.typicode.com/users", {
  method: "POST",
  body: JSON.stringify({ name: "Kyle" }),
})
headers
Now doing the above may look like all you need to do in order to pass JSON to an API, but this actually will not work. The reason is because you need to set the proper headers to tell your API that you are sending along JSON information. This headers option lets you set any HTTP header that you want.

fetch("https://jsonplaceholder.typicode.com/users", {
  method: "POST",
  body: JSON.stringify({ name: "Kyle" }),
  headers: { "Content-Type": "application/json" },
})
This above set of code is everything you need to do in order to pass JSON to an API.

Advanced Options
The above 3 options are what you will use for 90% of your fetch needs, but there are a few advanced options you should be aware of as well.

mode
The mode option allows you to specify if the request should be a cors, no-cors, or same-origin request. By default all fetch requests are setup as cors requests so you can access resources on other origins, but if you want you can force the fetch to only allow same-origin requests which will throw an error if you try to fetch a URL that is not on the same origin.

fetch("https://jsonplaceholder.typicode.com/users", {
  mode: "same-origin",
}).catch(e => console.error(e))
credentials
Another option that deals with cors is credentials. This options can either be omit, same-origin, or include and determines whether or not the fetch API passes along and receives cookies, and other credential based information. omit will send/receive no credentials. same-origin will only send/receive credentials from the same URL. include will send/receive credentials from any URL. By default this is set to same-origin.

fetch("https://jsonplaceholder.typicode.com/users", {
  credentials: "include",
})
signal
The final advanced option you need to know is the signal option. This option takes in an AbortSignal which can be used to abort a fetch request.

const controller = new AbortController()

fetch("https://jsonplaceholder.typicode.com/users", {
  signal: controller.signal,
}).catch(e => console.error(e.name)) // AbortError

controller.abort()
As you can see from the code this is a bit more complex then the other options. First you must create a new AbortController this controller has a signal property which is what you pass to the signal option. The controller also has an abort method that when called will abort the fetch request with the associated signal. This will cause the fetch promise to reject with an AbortError exception.

Advanced Fetch Uses
One thing that is confusing about the fetch API is that it will not throw an error if you get back a 404, 500, or any other error HTTP response. The only way you can determine if a request failed is to check the ok property of the response.

fetch("https://jsonplaceholder.typicode.com/users/-1").then(res => {
  console.log(res.ok) // false
  console.log(res.status) // 404
})
Because of this nuance I often will write out custom code to fail a request when the status is not ok.

fetch("https://jsonplaceholder.typicode.com/users/-1")
  .then(res => {
    if (res.ok) return res.json()
    return Promise.reject(res)
  })
  .then(data => console.log(data))
  .catch(res => console.error(res.status)) // 404
If the response is ok then I just keep all my code the same as normal, otherwise I will return a rejected promise that contains the response so I can handle it in a .catch.

I also sometimes will take this another step further and create my own custom fetch function.

function jsonFetch(url, { body, headers, ...options } = {}) {
  return fetch(url, {
    headers: { "Content-Type": "application/json", ...headers }
    body: JSON.stringify(body)
    ...options
  })
  .then(res => {
    if (res.ok) return res.json()
    return Promise.reject(res)
  })
  .then(res => res.json())
}
This custom function will take care of all the extra code I need to send JSON data and will still allow me to utilize all the custom options of fetch. It also handles throwing errors for things like 404s.

Now if you feel that doing something like this is too much of pain you can use a library like axios which is an abstraction over top of fetch that simplifies the API drastically.

Conclusion
The fetch API is a powerful tool that is easy to get started with but contains many advanced options for every imaginable use case.

So you just created an amazing application and now you need to actually get paid for it but you have no idea where to start. That is perfect because in this article I will show you step by step how to setup Stripe with Node.js and accept payments through this beautiful UI.

Setup
The first obvious step to get started is to create an account with Stripe. You will also need to make sure you fill in all information about your business (tax information, address, etc.) to ensure you are legally compliant before accepting payments. Once that is done the next step is to get your project setup.

You will need a Node.js server to integrate Stripe so if you do not already have a Node.js express server setup then you will need to do the following.

Setting Up An Express Server
Run npm init to create a package.json file for your project
Run npm i stripe express dotenv to install stripe, express, and dotenv
Create a file called server.js and include the following code.
// Load environment variables from the .env file into process.env
require("dotenv").config()

// Setup express
const express = require("express")
const app = express()
app.use(express.json())

// Setup Stripe
const stripe = require("stripe")(process.env.STRIPE_PRIVATE_KEY)

// This is the list of items we are selling
// This will most likely come from a database or JSON file
const storeItems = new Map([
  [1, { priceInCents: 10000, name: "Learn React Today" }],
  [2, { priceInCents: 15000, name: "Learn CSS Today" }],
])

// Start up our server on port 3000
app.listen(3000)
Connecting The Client Side
Before we write any more code for the server we are going to focus on how you connect the client side of your application to the server. In my opinion the best way to do this is with a fetch request since most likely your server will be an API that you are calling from your client. The code to do this is as follows.

// Initiate a POST request to the server
// If the server is on a different domain than the client
// then this needs to be the full url
// http://localhost:3000/create-checkout-session
fetch("/create-checkout-session", {
  method: "POST",
  headers: {
    "Content-Type": "application/json",
  },
  // Send along all the information about the items
  body: JSON.stringify({
    items: [
      {
        id: 1,
        quantity: 2,
      },
      {
        id: 2,
        quantity: 1,
      },
    ],
  }),
})
  .then(res => {
    if (res.ok) return res.json()
    // If there is an error then make sure we catch that
    return res.json().then(e => Promise.reject(e))
  })
  .then(({ url }) => {
    // On success redirect the customer to the returned URL
    window.location = url
  })
  .catch(e => {
    console.error(e.error)
  })
This is a lot of code so letâ€™s break down exactly what is happening. On the client we are making a request to an endpoint on our server and sending along the id and quantity of each item the customer wants to purchase. Then if the request is successful we redirect the customer to the url returned from the API.

Important Notes
If the server and client are on different domains then you will need to use the full server URL when doing the fetch request (http://localhost:3000/create-checkout-session instead of /create-checkout-session)
Never send price information from the client to the server. Since the customer has access to the client code they could change the price information if we send it from the client. This is why everything is done with ids on the client and the server handles all Stripe integration and pricing.
Connecting The Server Side
We now are able to make a request from the client to the server on an endpoint called /create-checkout-session. The next step for us is to create this endpoint on our server and return a valid URL to the client by adding the following code inside our server.js file.

// Create a post request for /create-checkout-session
app.post("/create-checkout-session", async (req, res) => {
  try {
    // Create a checkout session with Stripe
    const session = await stripe.checkout.sessions.create({
      payment_method_types: ["card"],
      // For each item use the id to get it's information
      // Take that information and convert it to Stripe's format
      line_items: req.body.items.map(({ id, quantity }) => {
        const storeItem = storeItems.get(id)
        return {
          price_data: {
            currency: "usd",
            product_data: {
              name: storeItem.name,
            },
            unit_amount: storeItem.priceInCents,
          },
          quantity: quantity,
        }
      }),
      mode: "payment",
      // Set a success and cancel URL we will send customers to
      // These must be full URLs
      // In the next section we will setup CLIENT_URL
      success_url: `${process.env.CLIENT_URL}/success.html`,
      cancel_url: `${process.env.CLIENT_URL}/cancel.html`,
    })

    res.json({ url: session.url })
  } catch (e) {
    // If there is an error send it to the client
    res.status(500).json({ error: e.message })
  }
})

Reducing load times by improving performance in an application is one of the best ways to improve user experience, and one of the easiest performance problems to fix is N + 1 queries. I personally have worked on applications where removing N + 1 queries reduced the load time of pages by 95%. It is very common for N + 1 query fixes to reduce page load time by 10% or more, so learning to address and fix them is crucial.

What Are N + 1 Queries
An N + 1 query is a common performance problem related to querying a database. This problem comes from having a page where a list of N items is displayed and each item has additional related information about it displayed that is not in the same database table as the items being displayed. Most of the time when pages like this are created one database query is done to get the list of N items. Those N items are then looped through and inside that loop a new database query is done to get the related information. This leads to N queries being done inside the loop on top of the one query to get the list of items, thus leading to the name N + 1 query. In order to further visualize this idea letâ€™s look at an example.

Imagine a page that lists a bunch of books and for each book it lists the name of the book and the name of the author. Also, imagine that for this application the database has two tables, one for books and one for authors. A common implementation of this page may look something like this.

const books = Book.getAll()
books.forEach(book => {
  const author = Author.findById(book.authorId)
  console.log(`${book.name} was written by ${author.name}.`)
})
This code works fine and prints out a list of books and their authors but it suffers from an N + 1 query. In the first line we get a list of all books, and then inside the loop we are querying for each individual author. Loading this page will lead to running queries that look something like this.

SELECT name, authorId FROM books;

SELECT name FROM authors WHERE authors.id = ${book_1.authorId};
SELECT name FROM authors WHERE authors.id = ${book_2.authorId};
SELECT name FROM authors WHERE authors.id = ${book_3.authorId};
...
SELECT name FROM authors WHERE authors.id = ${book_n-1.authorId};
SELECT name FROM authors WHERE authors.id = ${book_n.authorId};
Obviously, this isnâ€™t ideal since if there are 100 books in the list then 101 queries will be run which can drastically slow down the page load speed.

How To Fix N + 1 Queries
In order to fix this issue we need to run one query instead of N + 1 queries. To do this we need to take advantage of preloading, by loading all books and their authors in one query since we know that we need the author information for each book. This may look something like this.

const books = Book.getAllWithAuthor()
books.forEach(book => {
  console.log(`${book.name} was written by ${book.authorName}.`)
})
Now the only query being ran is inside the Book.getAllWithAuthor function. This query would look something like this.

SELECT books.name AS name, authors.name AS authorName FROM books
JOIN authors ON books.authorId = authors.id;
As you can see we are preloading all of the author names and books in one query so we never need to query the database again to get this information in the loop which means we only ever run one query no matter how large the book list becomes. Now writing these queries out by hand can be quite cumbersome and error prone which is why most popular database libraries will include their own way to preload data so you never have to worry about N + 1 queries.

Conclusion
N + 1 queries are one of the most common performance problems in apps, since they are very easy to write and hard to spot. Luckily, this problem is incredibly easy to fix, though, and only requires a little bit of extra analysis into the database queries being run to ensure N + 1 queries are avoided.

